<?phpnamespace Nemundo\App\Backup\Scheduler;use Nemundo\App\Backup\Data\Backup\BackupReader;use Nemundo\App\Backup\Type\AbstractBackup;use Nemundo\App\Scheduler\Job\AbstractScheduler;class BackupExportScheduler extends AbstractScheduler{    protected function loadScheduler()    {        $this->active = false;        $this->scriptName = 'backup-export';        $this->consoleScript = true;    }    public function run()    {        $reader = new BackupReader();        foreach ($reader->getData() as $backupRow) {            $backupRow->getBackup()->export();        }    }}